     &amp;sup3;  The long awaited followup to Twisted, this album follows the template     &amp;sup3;
     &amp;sup3;  set by the Deranger single: keeping the melodic mids at a moderate 3 to   &amp;sup3;
     &amp;sup3;  4 layers, the real interest is the tweaked pings and boings that swirl    &amp;sup3;
     &amp;sup3;  around and through the mix. Simon Postford's production skills transcend  &amp;sup3;
     &amp;sup3;  and define the standards of the genre, setting the bar a notch higher     &amp;sup3;
     &amp;sup3;  with each release. Any debate will have to fall upon his melodic skills.  &amp;sup3;
     &amp;sup3;  I've only JUST gotten this one in the post, so the musical hooks haven't  &amp;sup3;
     &amp;sup3;  had their chance to sink into my cerebrum, but scanning through, I can    &amp;sup3;
     &amp;sup3;  tell this one will get a lot of play. My only real qualm (as with other   &amp;sup3;
     &amp;sup3;  established artist's 2nd full lengths) is with the high proportion of     &amp;sup3;
     &amp;sup3;  previously released tracks or remixes, which take up half of this album.  &amp;sup3;
     &amp;sup3;  Though not credited as such, the &quot;Deranger&quot; here is a very mild remix of  &amp;sup3;
     &amp;sup3;  the single track, while the &quot;Snarling&quot; and &quot;Gamma Goblins&quot; take my        &amp;sup3;
     &amp;sup3;  favorite two from the debut and dements (less catchy, darker, more psy)   &amp;sup3;
     &amp;sup3;  them. There's a fun Gaelic tinwhistle melody to round out the album       &amp;sup3;
     &amp;sup3;  which I which was explored further with more contrapunctal lines, and I   &amp;sup3;
